INSERT INTO `content` VALUES (1,1,'2019-04-11 18:48:47',1,'2019-04-12 01:21:00','<p>Aux fils de nos agapes, à la lueur d\'un songe insomniaque, depuis les tréfonds de la nuit, le besoin impérieux de constituer des compilations musicales se fait parfois sentir.</p>','<p>Consulter le <a href=\"https://www.google.com/calendar/embed?src=3s3432r73c0k5scnvb6sruvp08%40group.calendar.google.com&amp;ctz=Europe/Paris\">calendrier</a> des sorties</p><p>Ce projet est développé par <a href=\"https://www.constructions-incongrues.net\">Constructions Incongrues</a> et hébergé par <a href=\"https://www.pastis-hosting.net\">Pastis Hosting</a></p><p>Le code source est diffusé sous licence <a href=\"https://github.com/constructions-incongrues/empilements\">AGPLv3</a>.</p><p>Design par <a href=\"http://goupilacneique.tumblr.com/\">Goupil Acnéique</a></p><p>Être tenu au courant des nouveautés <a href=\"http://feeds.feedburner.com/empilements-incongrus\">RSS</a> | <a href=\"http://feedburner.google.com/fb/a/mailverify?uri=empilements-incongrus&amp;loc=fr_FR\">Email</a> | <a href=\"http://www.facebook.com/empilements\">Facebook</a></p>');
